Method.Source:
[Form]
public class WMSPickingRoutesJournal extends FormRun
{
    InventDimCtrl_Frm_Mov   inventDimFormSetup;
    InventTransType         inventTransType;
    QueryBuildRange         qbrPickRequesterType;

}

void init()
{
    super();

    if (element.args().dataset() == tableNum(SalesTable))
    {
        inventTransType = InventTransType::Sales;
    }
    else if (element.args().dataset() == tableNum(InventTransferTable))
    {
        inventTransType = InventTransType::TransferOrderShip;
    }

    element.updateDesign(InventDimFormDesignUpdate::Init);
}

void updateDesign(InventDimFormDesignUpdate mode)
{
    SalesLine           salesLine;
    InventTransferLine  inventTransferLine;
    InventMovement      movement;

    if (inventTransType == InventTransType::Sales)
    {
        movement = InventMovement::construct(salesLine);
    }
    else
    {
        movement = InventMovement::construct(inventTransferLine);
    }

    switch (mode)
    {
        case InventDimFormDesignUpdate::Init :
            if (!inventDimFormSetup)
            {
                inventDimFormSetup  = InventDimCtrl_Frm_Mov::newFromFormMovement(element, movement);
            }

        case InventDimFormDesignUpdate::Active :
            inventDimFormSetup.formActiveSetup(movement.inventDimGroupSetup(), movement);
            inventDimFormSetup.formSetControls(true);
            break;

        case InventDimFormDesignUpdate::FieldChange :
            inventDimFormSetup.formActiveSetup(movement.inventDimGroupSetup(), movement);
            inventDimFormSetup.formSetControls(false);
            break;

        default : throw error(strFmt("@SYS54195",funcName()));
    }
}

public void init()
{
    super();

    if (element.args().dataset() == tableNum(SalesTable))
    {
        this.query().dataSourceTable(tableNum(WMSPickingRoute)).clearDynalinks();

        QueryBuildDataSource queryDataSourceLink = this.query().dataSourceTable(tableNum(WMSPickingRoute)).addDataSource(tableNum(WMSPickingRouteLink));
        queryDataSourceLink.relations(true);
        queryDataSourceLink.addDynalink(fieldNum(WMSPickingRouteLink, OrigInventTransRefId),
                                        element.args().record(),
                                        fieldNum(SalesTable, SalesId));
    }

    qbrPickRequesterType = this.query().dataSourceTable(tableNum(WMSPickingRoute)).addRange(fieldNum(WMSPickingRoute,TransType));
}
